import React from 'react';
import { Link } from 'react-router-dom';
import './styles.css';

const linksData = [
  { id: 1, title: 'Link 1' },
  { id: 2, title: 'Link 2' },
  { id: 3, title: 'Link 3' },
  // Add more links as needed
];

function LinksPage() {
  return (
    <div className="links-page">
      <main className="main-content">
        <ul className="links-list">
          {linksData.map((link) => (
            <li key={link.id}>
              <Link to={`/link/${link.id}`} className="link-button">
                {link.title}
              </Link>
            </li>
          ))}
        </ul>
      </main>
    </div>
  );
}

export default LinksPage;
